import { GlobalStyle } from '../styles';
import styled from 'styled-components';

const Test = styled.div`
  background-color: ${({ theme }) => theme.colors.primary};
  width: 500px;
  height: 500px;
`;

const Home = () => {
  return (
    <>
      <GlobalStyle />
      <Test />
    </>
  );
};

export default Home;
